import React from 'react';
import ajax from '@fdaciuk/ajax';

const Repos = ({ className, title, repos }) => (
  <div className="className">
    <h2>{title}</h2>
    <ul>
      {repos.map((repo, index) => (
        <li key={index}>
          <a href={repo.html_url}>{repo.name}</a>
        </li>
      ))}
    </ul>
  </div>
);

export default Repos;
